package main

import (
	"finger-print-voting-backend/internal/config"
	"finger-print-voting-backend/internal/database"
	"finger-print-voting-backend/internal/types"
	"finger-print-voting-backend/internal/users"
	"fmt"
	"log"
	"os"
)

func main() {
	log.Println("Loading Config")
	cfg := config.Load()

	log.Println("Connecting to Database")
	db, err := database.NewDatabase(cfg.DB)
	if err != nil {
		log.Println(err)
		return
	}

	if err := db.DropDBTables(); err != nil {
		log.Println(err)
		return
	}

	codebaseLoc, err := os.Getwd()
	if err != nil {
		log.Println(err)
		return
	}

	schemaLoc := fmt.Sprintf("%s\\internal\\database\\schemas", codebaseLoc)

	if err := db.SetupSchema(schemaLoc); err != nil {
		log.Println(err)
		return
	}

	if err := users.NewUser(db, types.User{
		Username:  "admin",
		Password:  "firstplease",
		Admin:     true,
		FirstName: "Admin",
		LastName:  "Account",
	}); err != nil {
		log.Println(err)
		return
	}

	log.Println("Created admin account")

	rawDB := db.Raw()

	electionsOld := []struct {
		start string
		end   string
		loc   string
	}{

		{
			start: "2021-09-11",
			end:   "2021-09-21",
			loc:   "Central Bedfordshire",
		},
		{
			start: "2022-09-11",
			end:   "2022-10-11",
			loc:   "Elmbridge",
		},
	}

	results := []types.ResultRequest{
		{
			ElectionID:  1,
			FirstName:   "Kira",
			LastName:    "Delacruz",
			Party:       "Women's Equality Party (WEP)",
			PartyColour: "#64B69A",
			Votes:       42,
		}, {
			ElectionID:  1,
			FirstName:   "William",
			LastName:    "Schaefer",
			Party:       "Liberal Party",
			PartyColour: "#EB7A43",
			Votes:       12,
		}, {
			ElectionID:  2,
			FirstName:   "Elmer",
			LastName:    "Johnson",
			Party:       "Democratic Unionist Party",
			PartyColour: "#D46A4C",
			Votes:       20223,
		}, {
			ElectionID:  2,
			FirstName:   "Harley",
			LastName:    "Shepherd",
			Party:       "Green Party of England and Wales",
			PartyColour: "#02A95B",
			Votes:       12322,
		},
	}

	for _, election := range electionsOld {
		log.Println("Election: ", election)
		_, err := rawDB.Exec(`INSERT INTO public.elections(
			election_start, election_end, authority_location)
			VALUES ($1, $2, $3);`, election.start, election.end, election.loc)
		if err != nil {
			log.Println(fmt.Sprint("Election Old Insert: ", err.Error()))
			return
		}
	}

	tx, err := db.Begin()
	if err != nil {
		log.Println(fmt.Sprint("failed to begin tx: ", err.Error()))
		return
	}
	for _, result := range results {
		log.Println("Result: ", result)
		db.StoreResult(tx, result)
		if err != nil {
			tx.Rollback()
			log.Println(fmt.Sprint("failed to store result: ", err.Error()))
			return
		}
	}
	err = tx.Commit()
	if err != nil {
		log.Println(fmt.Sprint("failed to commit tx: ", err.Error()))
		return
	}

	for _, election := range futureElections {
		log.Println("Ongoing Election: ", election)
		if err := db.StoreElection(election); err != nil {
			log.Println(fmt.Sprint("Store Election: ", err.Error()))
			return
		}
	}

	tx, err = db.Begin()
	if err != nil {
		log.Println(fmt.Sprint("failed to begin tx: ", err.Error()))
		return
	}
	voteArray := []int{420, 122, 530}
	nameCounter := 0
	for i, votes := range voteArray {
		log.Println("Storing User Batch: ", i)
		for j := 0; j < votes; j++ {
			db.StoreUser(tx, types.User{
				Username:  fmt.Sprintf("User %d", nameCounter),
				Password:  "password",
				Admin:     false,
				FirstName: "Blank",
				LastName:  "User",
			})
			if err != nil {
				tx.Rollback()
				log.Println(fmt.Sprint("failed to store user: ", err.Error()))
				return
			}
			nameCounter += 1
		}
	}

	err = tx.Commit()
	if err != nil {
		log.Println(fmt.Sprint("failed to commit tx: ", err.Error()))
		return
	}

	nameCounter = 0
	for i, votes := range voteArray {
		log.Println("Storing Votes: ", i)
		for j := 0; j < votes; j++ {
			err := db.StoreVote(types.Vote{
				ElectionID:  2,
				CandidateID: i + 1,
				Username:    fmt.Sprintf("User %d", nameCounter),
			})
			if err != nil {
				log.Println(fmt.Sprint("Store Vote: ", fmt.Sprintf("User %d", nameCounter), err.Error()))
				return
			}
			nameCounter += 1
		}
	}
}

